import React from "react";
import { Link } from "react-router-dom";
import adminPage from "../pages/adminPage";

export default function Navbar() {
  return (
    <div>
      <Link to="/admin" component={adminPage}>
        Admin
      </Link>
      <Link to="/userPage">User</Link>
    </div>
  );
}
